import React, { Fragment } from 'react';
import logo from './Assets/pngIcons/BASALT_master_main.png';

import './navBar.scss';

const NavBar = () => {
  return (
    <Fragment>
      <img src={logo} alt="Basalt Logo" />
    </Fragment>
  );
};

export default NavBar;
